import React from "react";
import "./navbar.css";

export default class Navbar extends React.Component {

  componentDidMount() {
    const Ulkitscript1 = document.createElement("script");
    Ulkitscript1.src = "https://cdn.jsdelivr.net/npm/uikit@3.10.1/dist/js/uikit.min.js";
    Ulkitscript1.async = true;

    const Ulkitscript2 = document.createElement("script");
    Ulkitscript2.src = "https://cdn.jsdelivr.net/npm/uikit@3.10.1/dist/js/uikit-icons.min.js";
    Ulkitscript2.async = true;

    document.body.appendChild(Ulkitscript1);
    document.body.appendChild(Ulkitscript2);

  }


  render() {

    return (

      <div className="uk-section-primary uk-preserve-color">

        <div uk-sticky="animation: uk-animation-slide-top; sel-target: .uk-navbar-container; cls-active: uk-navbar-sticky; cls-inactive: uk-navbar-transparent uk-light; top: 200">

          <nav className="uk-navbar-container">
            <div className="uk-container uk-container-expand">
              <div className="margin-left margin-top" uk-navbar="true">



                <ul className="uk-navbar-nav">

                <img 
                    id="icon" 
                    src="https://img.icons8.com/external-vitaliy-gorbachev-blue-vitaly-gorbachev/60/000000/external-bird-st-patrick-day-vitaliy-gorbachev-blue-vitaly-gorbachev.png"
                    alt=""

                    />

                  <li className="uk-active"><a href="/" id="logo-a"> ExamBird </a></li>

                  <li>
                    <a href="/"> Login </a>

                    {/* <div className="uk-navbar-dropdown">
                      <ul className="uk-nav uk-navbar-dropdown-nav">
                        <li className="uk-active"><a href="/"> Login </a></li>
                        <li><a href="/">Item</a></li>
                        <li><a href="/">Item</a></li>
                      </ul>
                    </div> */}

                  </li>

                  <li><a href="/">About</a></li>
                </ul>

              </div>
            </div>
          </nav>
        </div>

        <div className="uk-section uk-light">
          <div className="uk-container">

            <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum.</p>

            <p>Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum. Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris.</p>

            <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum.</p>

          </div>
        </div>

      </div>

    )


  }

};
